libs.content:
find_library(postgresql_library
	names ${postgresql_library_to_find}
	hints
		${postgresql_root_library_dirs}
	paths
		${postgresql_root_directories}
	path_suffixes
		lib
		${postgresql_library_additional_search_suffixes}

	doc "the ${postgresql_library_dir_message}"
)

find_library(pcre_library
  names pcre
  hints
        ${pcre_root_dir}/lib
        ${pcre_root_library_dirs}
  paths
        ${pc_pcre_library_dirs}
  doc "specify the lib directory containing pcre"
)

find_library(aprutil_library
  names aprutil-1 ${aprutil_names}
  hints
	${aprutil_root_dir}/lib
	${aprutil_root_library_dirs}
  paths
	${pc_aprutil_library_dirs}
	/usr/lib
	/usr/local/lib
)

find_library(apr_library
  names apr-1 ${apr_names}
  hints
	${apr_root_dir}/lib
	${apr_root_library_dirs}
  paths
	${pc_apr_library_dirs}
	/usr/lib
	/usr/local/lib
  )

find_library(lib_eay
      names
        ${lib_eay_names}
      names_per_dir
      ${_openssl_root_hints_and_paths}
      path_suffixes
        "lib/mingw"
        "lib"
    )

find_library(ssl_eay
      names
        ${ssl_eay_names}
      names_per_dir
      ${_openssl_root_hints_and_paths}
      path_suffixes
        "lib/mingw"
        "lib"
    )

find_library(openssl_crypto_library
    names
      crypto
    names_per_dir
    ${_openssl_root_hints_and_paths}
    hints
      ${_openssl_libdir}
    path_suffixes
      lib
  )
